const Header = () => {
  return (
    <nav>
      <span>
        <p id="nav_p"></p>
        <ul>
          <li onClick={onHomeClick}>Home</li>
          <li onClick={onProfileClick}>Profile</li>
        </ul>
      </span>
    </nav>
  );
};

export default Header;
